import React from "react";
import styles from "./Xiaomi.module.css"
import ProductContainer from "../Product/ProductContainer";

const Xiaomi = (props) => {

    if(props.Search!==""){
        let XiaomiElementSearch = props.xiaomi.filter(f=>f.name.toLowerCase().includes(props.Search)).map(ae=><ProductContainer key={ae.id} {...ae}/>)
        return<div className={styles.xiaomi}>

            {XiaomiElementSearch}
        </div>
    }

    let XiaomiElements = props.xiaomi.map(ae=><ProductContainer key={ae.id} {...ae}/>)

    return<div className={styles.xiaomi}>
        Xiaomi
        <div>
            {XiaomiElements}
        </div>
    </div>
}
export default Xiaomi;
